There are some great people out there doing the heavy lifting saving Americans lives in Afghanistan. We still have over 10,000 Americans trapped there. The ruthless Taliban are executing women in the street for hijab. Whipping children and pregnant woman into submission in Kabul. The Taliban is evil and they are now in control. 
Wanted to say thanks to some specific people that are putting their money where their mouth is. There is a lot of virtue signaling regarding #afghanistan but some NGO, people, and nonprofits are truly making a difference. 
